import React from "react";

function CarForm() {
  return (
    <div className="car-form panel">
      <h4 className="subtitle is-3">Add Car</h4>
      <form>
        <div className="field-group">
          <div className="field">
            <label className="label"></label>
          </div>
        </div>
      </form>
    </div>
  );
}

export default CarForm;
